import React, { Component } from 'react';
import "./flat.css";

class Flat extends Component {



    render() {

        const title = this.props.flats.price +
            this.props.flats.priceCurrency + " - " +
            this.props.flats.name;


        return (
            <div className="flat">
                <div className="flat-picture"></div>
                <div className="flat-title">
                    {title}
                </div>
            </div>
        );
    }
}

export default Flat;
